#include <stdio.h>
#include <stdlib.h>
#include <time.h>

int main() {
    int a,b;
    srand(time(NULL));
    a=(rand()%100)+1;
    printf("Please enter a number from 1 to 100:");
    scanf("%d\n", &b);
    if(b==a){
        printf("Bingo!\n");
        return 0;
    }
    else{
        printf("Please enter a number from 1 to 100:");
        scanf("%d\n", &b);
        if(b==a){
            printf("Bingo!\n");
            return 0;
        }
        else {
            printf("Please enter a number from 1 to 100:");
            scanf("%d\n", &b);
            if(b==a){
                printf("Bingo!\n");
                return 0;
            }
        }
    }
    printf("The Random Number is %d .\n", a);
    return 0;
}
